import React from "react";

function SignupLoginPage() {
  return (
    <div
      style={{
        height: "100vh",
        width: "100vw",
        backgroundColor: "black",
        display: "flex",
      }}
    >
      <div
        style={{
          backgroundColor: "#FFFFFF",
          height: "80vh",
          width: "86vw",
          marginLeft: "6vw",
          marginRight: "6vw",
          marginTop: "10vh",
        }}
      ></div>
    </div>
  );
}

export default SignupLoginPage;
